import React from 'react';
import { connect } from 'react-redux';
import { navChangeStyle, headerAccepted, hoverNav, enterMessagePage, leavePage } from '../actions';

class Contact extends React.Component {
    constructor(props) {
        super(props);
        this.props.navChangeStyle(true);
        this.props.hoverNav(false);
        this.props.headerAccepted(false);
        setTimeout(() => {
            this.props.enterMessagePage();
        }, 100);
    };

    state = {  isChecked: true, displayAfterSubmitting: false, phoneNumberDigitsWarning: false  };

    componentWillUnmount = () => {
        this.props.leavePage();
    }

    render() {
        return(
            <section className="contact"> 
                <div className="contact-bgsecondary"></div>
                <div className="contact-bgtertiary"></div>
                <div className="contact-elements">
                    <div className="contact-elements-title">
                        We are here to help
                    </div>
                    <div className="contact-elements-container"/>
                    <div className="contact-elements-item">
                        Technical Support
                        <img src="css/img/face_1.jpg" alt="technican" />
                        Contact our technician for any technical issues, from burned out light to any 
                        problems with the electronics
                    </div>
                </div>
            </section>
        );
    };
};


export default connect(null, { 
    navChangeStyle, headerAccepted, hoverNav, enterMessagePage, leavePage 
})(Contact);
